window.angular.module("helpers").service("storageService",["$window",function(e){this.saveLocal=function(t,o){e.localStorage.setItem(t,o)},this.getLocal=function(t){return e.localStorage.getItem(t)},this.saveSession=function(t,o){e.sessionStorage.setItem(t,o)},this.getSession=function(t){return e.sessionStorage.getItem(t)}}]);